    'help.WhatIsBrand': '\u041A\u0430\u043A\u0432\u043E \u0435 OLX?',
    'help.WhatIsBrand_content': 'OLX \u0435 \u0441\u0432\u0435\u0442\u043E\u0432\u043D\u0430 \u043E\u043D\u043B\u0430\u0439\u043D \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u0430 \u0437\u0430 \u043B\u043E\u043A\u0430\u043B\u043D\u043E \u043A\u0443\u043F\u0443\u0432\u0430\u043D\u0435 \u0438 \u043F\u0440\u043E\u0434\u0430\u0432\u0430\u043D\u0435, \u043E\u0431\u043C\u0435\u043D \u0438 \u043A\u043E\u043C\u0443\u043D\u0438\u043A\u0430\u0446\u0438\u044F \u0441 \u0434\u0440\u0443\u0433\u0438 \u043F\u043E\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043B\u0438.',
