    'about.AboutBrand': '\u0417\u0430 OLX',
    'about.AboutText1': 'OLX \u0435 \u0432\u043E\u0434\u0435\u0449\u0430\u0442\u0430 \u0432 \u0441\u0432\u0435\u0442\u0430 \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u0430 \u0437\u0430 \u043C\u0430\u043B\u043A\u0438 \u043E\u0431\u044F\u0432\u0438, \u0444\u043E\u043A\u0443\u0441\u0438\u0440\u0430\u0449\u0430 \u0432\u044A\u0440\u0445\u0443 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0449\u0438 \u0441\u0435 \u043F\u0430\u0437\u0430\u0440\u0438, \u043A\u0430\u043A\u0442\u043E \u043D\u0430 \u043C\u043E\u0431\u0438\u043B\u043D\u0438 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430, \u0442\u0430\u043A\u0430 \u0438 \u043E\u043D\u043B\u0430\u0439\u043D',
    'about.AboutText2': 'OLX \u0440\u0430\u0437\u0432\u0438\u0432\u0430 \u0434\u0435\u0439\u043D\u043E\u0441\u0442 \u0432 \u0433\u043B\u043E\u0431\u0430\u043B\u0435\u043D \u043C\u0430\u0449\u0430\u0431 \u0438 \u0438\u043C\u0430 \u043F\u0440\u0438\u0441\u044A\u0441\u0442\u0432\u0438\u0435 \u0432 \u043F\u043E\u0432\u0435\u0447\u0435 \u043E\u0442 40 \u0441\u0442\u0440\u0430\u043D\u0438',
    'about.about_Body': '<p>OLX \u0435 \u043D\u043E\u0432\u043E \u043F\u043E\u043A\u043E\u043B\u0435\u043D\u0438\u0435 \u0441\u0430\u0439\u0442 \u0437\u0430 \u0431\u0435\u0437\u043F\u043B\u0430\u0442\u043D\u0438 \u043C\u0430\u043B\u043A\u0438 \u043E\u0431\u044F\u0432\u0438.<br /><br />OLX \u043F\u0440\u0435\u0434\u043B\u0430\u0433\u0430 \u043B\u0435\u0441\u043D\u043E \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043D\u0438\u0435 \u043D\u0430 \u0443\u0441\u043B\u043E\u0436\u043D\u0435\u043D\u0438\u044F\u0442\u0430, \u043A\u043E\u0438\u0442\u043E \u043C\u043E\u0433\u0430\u0442 \u0434\u0430 \u0432\u044A\u0437\u043D\u0438\u043A\u043D\u0430\u0442 \u043F\u0440\u0438 \u043F\u0440\u043E\u0434\u0430\u0436\u0431\u0430\u0442\u0430, \u0437\u0430\u043A\u0443\u043F\u0443\u0432\u0430\u043D\u0435\u0442\u043E, \u0442\u044A\u0440\u0433\u043E\u0432\u0438\u044F\u0442\u0430,  \u043E\u0431\u0441\u044A\u0436\u0434\u0430\u043D\u0435\u0442\u043E, \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0438\u0440\u0430\u043D\u0435\u0442\u043E \u0438 \u0441\u0440\u0435\u0449\u0438\u0442\u0435 \u0441 \u0445\u043E\u0440\u0430, \u0436\u0438\u0432\u0435\u0435\u0449\u0438 \u0431\u043B\u0438\u0437\u043E \u0434\u043E \u0412\u0430\u0441, \u043A\u044A\u0434\u0435\u0442\u043E \u0438 \u0434\u0430 \u0441\u0435 \u043D\u0430\u043C\u0438\u0440\u0430\u0442\u0435.<br /><br />\u0412 OLX \u0412\u0438\u0435 \u043C\u043E\u0436\u0435\u0442\u0435:<br /><ul><li>\u0414\u0430 \u0441\u044A\u0437\u0434\u0430\u0432\u0430\u0442\u0435 \u043B\u0435\u0441\u043D\u043E \u0431\u043E\u0433\u0430\u0442\u0438 \u043E\u0431\u044F\u0432\u0438 \u0441\u044A\u0441 \u0441\u043D\u0438\u043C\u043A\u0438.</li><li>\u0434\u0430 \u043A\u043E\u043D\u0442\u0440\u043E\u043B\u0438\u0440\u0430\u0442\u0435 \u0447\u0440\u0435\u0437 "\u041C\u043E\u044F\u0442 OLX" \u0412\u0430\u0448\u0438\u0442\u0435 \u043F\u043E\u043A\u0443\u043F\u043A\u0438 \u0438 \u043F\u0440\u043E\u0434\u0430\u0436\u0431\u0438, \u0430 \u0441\u044A\u0449\u043E \u0438 \u0412\u0430\u0448\u0430\u0442\u0430 \u0430\u043A\u0442\u0438\u0432\u043D\u043E\u0441\u0442 \u0432 "\u041E\u0431\u0449\u043D\u043E\u0441\u0442"; </li><li>\u0434\u0430 \u043F\u043E\u043A\u0430\u0437\u0432\u0430\u0442\u0435 \u0412\u0430\u0448\u0438\u0442\u0435 \u043E\u0431\u044F\u0432\u0438 \u0432\u044A\u0432 \u0412\u0430\u0448\u0438\u044F \u043F\u0440\u043E\u0444\u0438\u043B \u043A\u044A\u043C \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u0438 \u043C\u0440\u0435\u0436\u0438(Facebook, Myspace, ...;)</li><li>\u0434\u0430 \u0432\u043B\u0438\u0437\u0430\u0442\u0435 \u0432 \u0441\u0430\u0439\u0442\u0430 \u0447\u0440\u0435\u0437 \u043C\u043E\u0431\u0438\u043B\u043D\u0438\u044F \u0441\u0438 \u0442\u0435\u043B\u0435\u0444\u043E\u043D</li><li>\u0434\u0430 \u0440\u0430\u0437\u0433\u043B\u0435\u0436\u0434\u0430\u0442\u0435 OLX \u043D\u0430 \u0412\u0430\u0448\u0438\u044F \u0440\u043E\u0434\u0435\u043D \u0435\u0437\u0438\u043A</li></ul><br />OLX \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u043D\u0430 <<QTY_LANGUAGES>> \u0435\u0437\u0438\u043A\u0430 \u0432 \u043F\u043E\u0432\u0435\u0447\u0435 \u043E\u0442 <<QTY_COUNTRIES>> \u0434\u044A\u0440\u0436\u0430\u0432\u0438. \u041A\u043E\u043C\u043F\u0430\u043D\u0438\u044F\u0442\u0430 \u0435 \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0430 \u043F\u0440\u0435\u0437 \u043C\u0430\u0440\u0442 2006 \u0438 \u0435 \u0447\u0430\u0441\u0442\u043D\u0430 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043E\u0441\u0442.</p>',
